#include <fstream>

using namespace std;

ifstream fin("maxd.in");
ofstream fout("maxd.out");

int main() {
  int a, b, maxd = 0, min = 0, nr = 0;
  fin >> a >> b;
  for (int i = a; i <= b; i++) {
    int d = 0;
    for (int j = 1; j * j <= i; j++) {
      if (i % j == 0) {
        d += 2;
        if (j * j == i) d--;
      }
    }
    if (d > maxd) {
      maxd = d;
      min = i;
      nr = 1;
    } else if (d == maxd) nr++;
  }
  fout << min << " " << maxd << " " << nr << "\n";
  return 0;
}
